import PhotoStrip from "./PhotoStrip";
import "./App.css";
import LivePhoto from "./LivePhoto";
import { useEffect, useState } from "react";
import { Grid } from "@material-ui/core";

function App() {
    const [sessionPhotos, setSessionPhotos] = useState([]);
    const fetchData = () => {
        fetch("http://localhost:8000/data")
            .then((res) => res.json())
            .then(
                (result) => {
                    setSessionPhotos(result.currentCapture);
                    console.log(sessionPhotos);
                },
                (error) => {
                    console.log(error);
                }
            );
    };

    useEffect(() => {
        const getData = () => {
            // fetch("http://localhost:8000/data")
            //     .then((res) => res.json())
            //     .then(
            //         (result) => {
            //             setSessionPhotos(result.currentCapture);
            //             console.log(sessionPhotos);
            //         },
            //         (error) => {
            //             console.log(error);
            //         }
            //     );
            fetchData();
        };
        getData();
    }, [sessionPhotos]);
    return (
        <Grid container>
            <Grid item xs={12} md={8}>
                <LivePhoto getData={getData} />
                <br />
            </Grid>
            <Grid item xs={12} md={4}>
                <PhotoStrip photos={sessionPhotos} />
            </Grid>
        </Grid>
    );
}

export default App;
